import React from 'react';
import Accordion from 'react-bootstrap/Accordion';

export default function DateAccordion({date}) {
    return (
        <Accordion>
            <Accordion.Item>
            <Accordion.Header>
                {date}
            </Accordion.Header>
            <Accordion.Body>
                sample
            </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    )
}
